property.value:
async function execute(taskId) {
    const moduleTaskResult = await executeModuleTask("Intent.Modules.Common.AI.Tasks.ProviderModelsTask");

    const providerModels = JSON.parse(moduleTaskResult);
    const modelLookup = providerModels.reduce((acc, item) => {
        acc[`${item.providerId}--${item.modelName}`] = item;
        return acc;
    }, {});
    
    const globalSettings = await userSettings.loadGlobalAsync();
    const unitTestsAiModelId = globalSettings.get("AI.UnitTests.ModelId");
    const unitTestsAiThinkingType = globalSettings.get("AI.UnitTests.ThikingType");

    // Open a dialog for the user to enter an AI prompt
    let promptResult = await dialogService.openForm({
        title: "AI: Generate Unit Test for " + element.getName(),
        icon: "data:image/svg+xml;base64,",
        fields: [ 
            {
                id: "prompt",
                fieldType: "textarea",
                label: "Provide any additional context",
                placeholder: "Leave blank if you wish to provide no additional context.",
                hint: "NOTE: Additional context will be combined with the Intent Architect auto-generated prompt to guide the AI Agent."
            },
            {
                id: "model",
                fieldType: "select",
                label: "Model",
                isRequired: true,
                hint: providerModels.length === 0 ? "Not seeing any AI Models? Learn how to configure or add models [here](https://docs.intentarchitect.com/articles/modules-common/intent-common-ai/intent-common-ai.html)." : "",
                selectOptions: 
                    Object.entries(modelLookup)
                    .map(([key, value]) => { 
                        return { 
                            id: key, 
                            description: value.modelName, 
                            additionalInfo: value.providerName
                        }; 
                    }),
                value: unitTestsAiModelId,
                onChange: async (config) => {
                    const curThinkingType = modelLookup[config.getField("model").value].thinkingType;
                    
                    config.getField("thinking").isHidden = curThinkingType === "None";

                    if (curThinkingType === "ToggleThinking" || curThinkingType === "ThinkingLevels") {
                        config.getField("thinking").value = "low";
                    } else {
                        config.getField("thinking").value = null;
                    }
                }
            },
            {
                id: "thinking",
                fieldType: "select",
                label: "Thinking/reasoning mode",
                isHidden: unitTestsAiThinkingType == null || providerModels.length === 0,
                value: unitTestsAiThinkingType,
                selectOptions: [
                    {
                        id: "low",
                        description: "Low",
                        additionalInfo: "Thinks less, quicker"
                    },
                    {
                        id: "high",
                        description: "High",
                        additionalInfo: "Thinks more, slower"
                    }
                ]
            }
        ],
        submitButtonText: "Execute",
        minWidth: "750px"
    });
    // Check if the user cancelled
    if (!promptResult) {
        return;
    }

    const providerId = modelLookup[promptResult.model].providerId;
    const modelId = modelLookup[promptResult.model].modelName;
    const thinkingType = promptResult.thinking;

    globalSettings.set("AI.UnitTests.ModelId", `${providerId}--${modelId}`);
    globalSettings.set("AI.UnitTests.ThikingType", thinkingType);

    let result = await launchHostedModuleTask(taskId, 
        [
            application.id, 
            element.id, 
            promptResult.prompt ?? "",
            providerId, 
            modelId, 
            thinkingType
        ], 
        {
            taskName: "AI: Unit tests for " + element.getName()
        });

    const unitTestStereotype = "4965bed2-6320-49d1-beba-0fbc6fd4dfe6";
    if(!element.hasStereotype(unitTestStereotype))
    {
        element.addStereotype(unitTestStereotype); // Unit Test stereotype
    }

    return result;
}
